import React from 'react';
import './Title.css';
import { TweenMax, Power3 } from 'gsap';

// Title Component view
export default function RetuRnTitle() {

 React.useEffect(() => {
  TweenMax.from('.wrp-title h1', 1.2, { delay: 0.5, opacity: 0, y: 50 });
  TweenMax.from('.wrp-title p', 1.2, { delay: 1.2, opacity: 0, y: 50 });
 }, []);

 return (
  <div className='wrp-title'>
   <h1>Connectez-vous</h1>
   <p>Heureux de vous revoir ! Connectez-vous pour utiliser l'application.</p>
  </div>
 )
}
